7C129BF9-607E-4F95-909A-067565FFFCD0.source:
var speed;
var moveDistance = 0.1;
var moveVector = new THREE.Vector3(0,0,-1);

var accelerationTime = 3.0;
var deccelerationTime = 1.0;
var movementSpeed = 0.9;

var moveMult = 0.0;

var isMoving = false;

function update( event ) {

	var delta = (isNaN(event.delta)) ? 0 : event.delta/1000;


	if(isMoving){

		moveMult += delta * movementSpeed / accelerationTime; 		
	}
	else{
		moveMult -= delta * movementSpeed / deccelerationTime; 		
	}

	moveMult =  Math.min(Math.max(moveMult, 0.0), movementSpeed)

	camera.translateX( moveVector.x * moveMult );
	camera.translateY( moveVector.y * moveMult );
	camera.translateZ( moveVector.z * moveMult );


}

function touchstart( event ) {

	isMoving = true;
}

function touchend( event ) {

	isMoving = false;
}

function mousedown( event ) {

	isMoving = true;
}

function mouseup( event ) {

	isMoving = false;
}
